import React from "react";

import Task from "../Components/Task";

const TaskList = ()=> {
    return (
        <ul className="todo-list">

                <li className="completed">
                   <Task/>
                </li>
                <li className="editing">
                    <Task/>
                    <input type="text" className="edit" value="Editing task"/>
                </li>
                <li>
                    <Task/>
                </li>

        </ul>
    );
};
export default TaskList;
